import './App.css';
import { useState } from "react";

function App() {
  const [listofPatients, setlistofPatients] = useState ([])

  return (
    <div className="App">
      <div className = "patientsDisplay"> 
        {listofPatients.map((user) => {
          return (
            <div>
              <h1>Name: {user.name}</h1>
              <h1>Gender: {user.gender}</h1>
              <h1>Date of Birth: {user.dob}</h1>
              <h1>user.height</h1>
              <h1>user.weight</h1>
              <h1>user.email</h1>
              <h1>user.medicalHistory</h1>
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default App;
